import {BrowserRouter as Route, BrowserRouter, Routes} from 'react-router-dom'
import Login from './components/Login';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
      {/* <Switch> */}
        <Route path='/login' Component={Login} />
     {/* // </Switch> */}
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
